    private List<String> getCampusUserDataAll(String accessToken, String requsturi) throws IOException {
        int pageNum = 1;
        String myCampus = getJsonData(accessToken, requsturi+pageNum);
        pageNum++;
        List<String> logins = extractValuesToList(myCampus,"id");
        while (true){
            myCampus = getJsonData(accessToken, requsturi+pageNum);
            List<String> logs = extractValuesToList(myCampus,"id");
            if (myCampus == null || myCampus.isEmpty() || logs.isEmpty())
                break;
            pageNum++;
            System.out.println("pageNum = " + pageNum);
            logins.addAll(logs);
        }
        if(myCampus.equals("[]")) {
            System.out.println("myCampus = NULL");
        }
        else
            System.out.println("myCampus = " + myCampus);
        System.out.println("logins.size = " + logins.size());
        return logins;
    }

    private String getJsonData(String accessToken, String requsturi) {
        String myCampus = oauth2Service.getUri(accessToken, requsturi);
        return myCampus;
    }

    public String extractValueFromJson(String json, String key) throws IOException {
        ObjectMapper mapper = new ObjectMapper();
        JsonNode root = mapper.readTree(json);

        if (root.has(key)) {
            return root.get(key).asText();
        } else {
            return null;
        }
    }

    public List<String> extractValuesToList(String json, String key) throws IOException {
        ObjectMapper mapper = new ObjectMapper();
        JsonNode root = mapper.readTree(json);

        List<String> values = new ArrayList<>();
        root.forEach(node -> {
            if (node.has(key)) {
                values.add(node.get(key).asText());
            }
        });

        return values;
    }
